function HooksClasses() {
    const [count, setCount] = useState(0);
    return(
        <div>
            <h1>{`Hii you have clicked ${count} times`}
            <button onClick={() => setCount(count + 1)}>Click me!!</button></h1>
        </div>
    )
}

export default HooksClasses;


















